import { BrowserRouter, Route, Link } from 'react-router-dom';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

export function signin() {
    return (
        <div>
            <Route exact path="/signin" component={() =>
                <>
                    <p>Sign in page WIP</p>
                </>
            } />
        </div>
    )
}
